import React from "react";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import LoginPage from "./pages/LoginPage";
import EmployeeDashboard from "./pages/EmployeeDashboard";
import ApplyLeaveForm from "./pages/ApplyLeaveForm";
import ManagerApprovalPage from "./pages/ManagerApprovalPage";
import ReportsPage from "./pages/ReportsPage";
import ProtectedRoute from "./components/ProtectedRoute";
import NavBar from "./components/NavBar";

const App = () => (
  <Router>
    <NavBar />
    <Routes>
      <Route path="/login" element={<LoginPage />} />
      <Route path="/dashboard" element={<ProtectedRoute><EmployeeDashboard /></ProtectedRoute>} />
      <Route path="/apply" element={<ProtectedRoute><ApplyLeaveForm /></ProtectedRoute>} />
      <Route path="/manager" element={<ProtectedRoute><ManagerApprovalPage /></ProtectedRoute>} />
      <Route path="/reports" element={<ProtectedRoute><ReportsPage /></ProtectedRoute>} />
      <Route path="*" element={<LoginPage />} />
    </Routes>
  </Router>
);

export default App;
